import logo from './logo.svg';
import './App.css';

function App() {
  return (
   <nav>
    <div className="logo">
      <img src="dp7.jpg" alt="logo" />
      <h1>Rahul Sharma</h1>
    </div>
    <div className="nav-links">
      <a href="#home">Home</a>
      <a href="#about">About</a>
      <a href="#skills">Skills</a>
      <a href="#projects">Projects</a>
      <a href="#contact">Contact</a>
    </div>
  </nav>
  );
}

export default App;
